import Vue from "vue";
import Vuetify from "vuetify/lib/framework";

Vue.use(Vuetify);

export default new Vuetify({
  theme: {
    themes: {
      light: {
        primary: "#4CC2CB",
        secondary: "#2F355A",
        info: "#2FAB623",
        accent: "#4CC2CB",
        error: "#ff9999",
        success: "#8BC34",
        warning: "#fab623",
      },
      dark: {
        primary: "#212748",
        secondary: "#16A4AF",
        info: "#2FAB623",
      },
    },
  },
});
